def FittingLabels(sequence):
    sequence = sequence.upper()
    # print(sequence)
    MarkerLabel = []
    OriginLabel = []
    MarkerResult = MarkerKmer.query(sequence)
    print(MarkerResult)

    for match in MarkerResult.keys():
        seq_Name = MarkerResult[match]['seq_id']
        db_seq = MarkerDict[seq_Name]
        q_start = MarkerResult[match]['start']
        q_end = MarkerResult[match]['end']
        db_start = MarkerResult[match]['offset'] + MarkerResult[match]['start']
        db_end = MarkerResult[match]['offset'] + MarkerResult[match]['end']
        query_segment = sequence[q_start:q_end]
        db_segment = db_seq[db_start:db_end]

        match_length = len(query_segment)
        if( match_length > 0):
            identical = sum(1 for a,b in zip(query_segment,db_segment) if a==b)
            similarity  = round(identical / match_length,3)
            if(similarity >= 0.9):
                MarkerLabel.append({"Name":seq_Name,"q_start":q_start,"q_end":q_end})

    OriginResult = OriKmer.query(sequence)
    print(OriginResult)
    for match in OriginResult.keys():
        seq_Name = OriginResult[match]['seq_id']
        db_seq = OriginDict[seq_Name]
        q_start = OriginResult[match]['start']
        q_end = OriginResult[match]['end']
        db_start = OriginResult[match]['offset'] + OriginResult[match]['start']
        db_end = OriginResult[match]['offset'] + OriginResult[match]['end']
        query_segment = sequence[q_start:q_end]
        db_segment = db_seq[db_start:db_end]

        match_length = len(query_segment)
        if( match_length > 0):
            identical = sum(1 for a,b in zip(query_segment,db_segment) if a==b)
            similarity  = round(identical / match_length,3)
            if(similarity >= 0.9):
                OriginLabel.append({"Name":seq_Name,"q_start":q_start,"q_end":q_end})
    # print({"Marker":MarkerLabel,"Origin":OriginLabel})
    return {"Marker":MarkerLabel,"Origin":OriginLabel}


